import React from 'react';
import './App.css';
import imagen from './todos.jpg';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <section>
        <img src={imagen} alt="imagen" width="42" height="42"></img>
        </section>

        <h1>Aquarella Fotografia</h1>
        <h3>By Noelia Abate</h3>
      </header>
      <nav className="App-menu">
          <ul>
            <li>Portfolio</li>
            <li>Contacto</li>
            <li>Precios</li>
          </ul>
      </nav>
    </div>
  );
}

export default App;
